 also running low on food, but have enough clean water that would last you for several days. All the shops in the town are closed, so it is uncertain whether you can use the money to purchase goods. Given the circumstances, you know that no other aid package will be received for another week. The aid packages include medicine including penicillin, canned food, some money and water bottles.<\/p><p>In the task that follows, you have to negotiate how these items have to be split between your family and the other household. You do not know how much food and water the other family has.<\/p><p>The negotiation is done in a sequence of alternating offers. You will make the first offer. The other negotiator may or may not accept your offer. If it does not accept it, that is, if it rejects your offer, it will send you a new offer. You can either accept or reject its offer. If you accept it, you will get to keep the items that you did not give them. If you reject their offer, you can make another offer and submit it to them. If after 24 rounds there is no agreement, the negotiation will end in \u201Cno agreement.\u201D In this case, you both will only receive one of each item and the rest will be given away.<\/p><p>Try to get as many items as you can. <\/p><p>Here are the icons representing the objects:<\/p><p>Medicine: <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="Medicine" width="42" height="42" /><\/p><p>Water Bottles: <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="Water Bottles" width="42" height="42" /><\/p><p>Money: <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="Money" width="42" height="42" /><\/p><p>Food Cans: <img src="http://emotions.usc.edu/group/images/can-new.png" alt="Food Cans" width="42" height="42" /><\/p>',Ivd='<pre>',ffd='<span',wjd="<span style='color:",POd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style><ul><li>Behind this window is the trading board where all the items are located.<\/li><\/ul><ul><li>You need to decide how to divide the items between you and the opponent by dragging each item and putting it either on your own side or on the other side.<\/li><\/ul><ul><li>Your side is the bottom section and the upper section belongs to the opponent.<\/li><\/ul><ul><li>No item should be left in the middle. You can take all of the items or give them all away, or take some and not others. It is up to you how to allocate the items.<\/li><\/ul><ul><li>When you are done with splitting the items, click on "Make Initial Proposal".<\/li><\/ul><ul><li>If the opponent does not accept your offer, he or she will propose a new offer.<\/li><\/ul><ul><li>If you are happy with an offer, click on Accept Proposal.<\/li><\/ul><ul><li>If you want to make a new proposal, redistribute the items and then click on "Make Counterproposal".<\/li><\/ul><ul><li>You can review the description of the scenario at each point in time of the game.<\/li><\/ul><\/font>',KOd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>Imagine you work for the National Security Agency (NSA). The mission of the NSA is first, to protect sensitive and secret national security information from foreign espionage, second, to collect foreign signals to support military operations, and third, to defeat terrorists and their organizations. As a matter of principle, all operations need legal permission in order to be consistent with U.S. laws and the protection of privacy and civil liberties.<br><br>Having said this, you have witnessed that the NSA operates under principles that are not in accordance with U.S. laws and are therefore unconstitutional. The director of the NSA instructed you to engage in a global and indiscriminate mass-surveillance program. In addition to collecting the emails, text messages, and telephone calls of all American citizens, you are delegated to access and save data from online services like Google and Facebook, through a number of different platforms including smartphones, and Microsoft and Apple computers. This is done regardless of any existing suspect cases. You realize that these tasks defeat the purpose of the NSA\u2019s mission to protect American citizens from foreign attacks and rather fill the position of an indiscriminate surveillance program, which is in fact illegal. By obeying and executing these instructions, you become an accessory of illegal and unconstitutional operations. For these reasons you decide to disclose classified documents of the NSA, proving its felonious operations, to several media sources, with the aim of realizing a reform of the NSA\u2019s operation principles. The director of the NSA learns about your intentions and as a matter of prudence is willing to negotiate with you. Naturally, his aim is to stop you from revealing the secret information.<br><br>In the task that follows you have to negotiate with an opponent (taking the side of the Director of the NSA), about the future course of action. The negotiation matters focus on handing back the documents in return for (a) reforms of the unconstitutional operation principles or (b) a bonus payment. In the task the following symbols represent the corresponding actions:<br><br><table><tr><td width="370px" valign="middle" height="55px"><Label-style>1. Document that proves one unconstitutional operation:<\/td><td width="300px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/document.png" alt="Documents" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>2. Reform of one unconstitutional operation:<\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/reform.png" alt="Reform" width="42" height="42" /><\/td><\/tr><tr><td valign="middle" height="55px"><Label-style>3. A bonus payment of $100,000:<\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/money.png" alt="Bonus" width="42" height="42" /><\/td><\/tr><\/table><\/li><\/ul>The negotiation is done in a sequence of alternating offers. You will make the first offer. The other negotiator may or may not accept your offer. If your offer is not accepted, you will receive a new offer. You can either accept or reject the offer. If you reject the offer, you can propose a new offer. If after 6 rounds there is no agreement, the negotiation will end in no agreement. Try to reach the most favorable agreement for yourself.<br><br>You can express your felt emotions anytime during the game. The preset expression is neutral. If you click on one of the facial displays it will be immediately shown to the other participant and returns to neutral after 5 seconds. Similarly, when the other participant expresses his/her emotion, the facial display will be shown to you. Three facial displays you can choose include:<\/li><table><tr><td width="170px" valign="middle" height="55px"><Label-style>1. Angry:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/angry.gif" alt="Angry" height="50" /><\/td><td width="130px" valign="middle"><Label-style>2. Neutral:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/neutral.gif" alt="Neutral" height="50" /><\/td><td width="170px" valign="middle" height="55px"><Label-style>3. Sad:    <\/td><td width="130px" valign="middle"><img src="http://shiraz.usc.edu/negotiation/images/sad.gif" alt="Sad" height="50" /><\/td><\/tr><\/table><\/ul><\/Label-style>',LFd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>Thank you for choosing to participate in our survey. The following questions are part of a large social experiment involving a group of scientists from the University of Southern California. Our research group is interested in investigating human decision-making in negotiations. We are not affiliated with any political group or think tank. Your answers will be used in a strictly scientific manner.<br />We would like to ensure you that our survey is collected anonymously and sophisticated encryption techniques are used to make sure that your answers remain confidential.<\/p><p>In this questionnaire, you will be asked to participate in a negotiation task with another participant involving a hypothetical negotiation scenario. Negotiation is an important part of commerce, everyday decision making, and it is important in today\'s society. Negotiation is about trying to reach agreement on issues that matter. Your negotiation will involve the ownership of items which represent the documents, monetary bonuses and the implementation of reforms.<br />In the negotiation that follows you are asked to find an agreement with your opponent about how to allocate the items. In other words, you will negotiate with the other opponent on how many items you are willing to give to him or her and how many you will keep for yourself.<\/p><p>The whole survey usually takes about 20 minutes to answer.<\/p><p>Before you begin the survey, please click on "Open the Experiment Information Sheet" below which informs you about your rights as a participant in a scientific survey. It is a standard form used with all of our studies so some of the information might not be directly relevant to you. After you read the Information sheet, please click on "I agree to participate." to start the experiment. If you do not agree with the terms described in the information sheet, please click on "I do not agree to participate."<br /><\/Label-style>',_Kd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 14px;}<\/style><Label-style>This is the last round of the negotiation. At this point, you can either decide to accept the other player\'s proposal by clicking on "Accept proposal" or if you don\'t agree with the proposal, you can decide to toss a coin by clicking on "Toss
